import React from 'react';
import {
  Container,
  Typography
} from '@material-ui/core';
import {
  Apps as AppsIcon
} from '@material-ui/icons';

export default function AppControlContainer(){
  return(
    <Container>
      <AppsIcon />
      <Typography>App Protection</Typography>
      <Typography>Apps Blocked: 3</Typography>
    </Container>
  )
};
